import { Link } from "react-router-dom";

function Header(){
    return(
        <div id="header">
            <Link to="/home"><h1>cook.ie</h1></Link>
            <input></input>
            <div id="nav">
                <ul>
                    <li></li>
                </ul>
            </div>
        </div>
    )
}

export default Header;
